// src/App.js - Main App with Navigation and Category Filtering

import React, { useState, useEffect } from 'react';
import './index.css';
import ResumeBuilder from './Resumebuilder'; // Assuming Resumebuilder.js exists

// This component now handles the logic for showing categories or a filtered list
function OpportunitiesView() {
  const [opportunities, setOpportunities] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [selectedCategory, setSelectedCategory] = useState(null); // NEW: To track the selected category

  // This useEffect fetches ALL opportunities once when the component loads
  useEffect(() => {
    // We will use the development server for now for faster coding
    fetch('http://localhost:3001/api/opportunities')
      .then(response => {
        if (!response.ok) {
          throw new Error('Network response was not ok. Is the server running?');
        }
        return response.json();
      })
      .then(data => {
        setOpportunities(data);
        setLoading(false);
      })
      .catch(error => {
        setError(error.message);
        setLoading(false);
      });
  }, []);

  // --- Helper logic to get unique categories from our data ---
  const categories = [...new Set(opportunities.map(op => op.type))];

  // --- Render logic ---
  if (loading) {
    return <div>Loading...</div>;
  }
  if (error) {
    return <div className="error-message">Error: {error}</div>;
  }

  // If a category IS selected, show the filtered list
  if (selectedCategory) {
    const filteredOpportunities = opportunities.filter(op => op.type === selectedCategory);
    return (
      <div>
        <div className="view-header">
          <button className="back-button" onClick={() => setSelectedCategory(null)}>
            &larr; Back to Categories
          </button>
          <h2>{selectedCategory}</h2>
        </div>
        <div className="opportunities-list">
          {filteredOpportunities.map(op => (
             <div className="opportunity-card" key={op.id}>
               <h3>{op.title}</h3>
               <p>{op.description}</p>
               <a href={op.url} target="_blank" rel="noopener noreferrer">Learn More</a>
             </div>
          ))}
        </div>
      </div>
    );
  }

  // If NO category is selected, show the category selection grid
  return (
    <div>
      <h2>Explore Opportunities</h2>
      <div className="category-grid">
        {categories.map(category => (
          <div key={category} className="category-card" onClick={() => setSelectedCategory(category)}>
            <h3>{category}</h3>
          </div>
        ))}
         <div key="all" className="category-card" onClick={() => alert('This would show all opportunities!')}>
            <h3>View All</h3>
          </div>
      </div>
    </div>
  );
}


// --- Main App Component (handles navigation between pages) ---
function App() {
  const [activeView, setActiveView] = useState('opportunities');

  return (
    <div className="App">
      <header>
        <h1>PathFinder</h1>
        <nav className="nav">
          <button
            className={`nav-button ${activeView === 'opportunities' ? 'active' : ''}`}
            onClick={() => setActiveView('opportunities')}
          >
            Opportunities
          </button>
          <button
            className={`nav-button ${activeView === 'resume' ? 'active' : ''}`}
            onClick={() => setActiveView('resume')}
          >
            AI Resume Builder
          </button>
        </nav>
      </header>

      <main>
        {activeView === 'opportunities' && <OpportunitiesView />}
        {activeView === 'resume' && <ResumeBuilder />}
      </main>
    </div>
  );
}

export default App;
